import { Link } from "react-router-dom";

const Logo = ({ type }) => {
  return (
    <div className=''>
      <Link
        to='/'
        className={`text-2xl font-semibold ${type && "text-white text-4xl"}`}
      >
        Blog
        <span
          className={`text-3xl text-light-500 ${type && " text-5xl font-bold"}`}
        >
          Site
        </span>
      </Link>
    </div>
  );
};

export default Logo;
